import React from 'react';
import * as FIcons from "react-icons/fa";
import { Link } from 'react-router-dom';
function Sidebar() {
    return (
    <>
        <div className="navbar">
            <Link to="#" className="menu-bars">
                <FIcons.FaBars />
            </Link>
        </div>
    </>
    );
}

export default Sidebar;
